import React from "react";
import "./carrusel.css";
import Slider from 'react-slick';
import 'slick-carousel/slick/slick-theme.css'
import 'slick-carousel/slick/slick.css'


class Carousel extends React.Component {
  render() {
    var props = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToSw: 1,
      slidesToScroll: 1,
      width: 100
    };
    return (

      <Slider>
    <div className="slider">

        <ul className="  images-carousel">

            <div>
              <img className="images-carousel" src="" alt=""/>
            </div>
           <div>
              <img className="images-carousel" src="./images/carousel5/High-Definition-700x300.jpg" alt=""/>
            </div>
          <div>
              <img className="images-carousel" src="./images/carousel4/High-Definition-700x300.jpg" alt=""/>
          </div>

        </ul>
      </div>
      </Slider>






    );
  }
}
export default Carousel;
